import './App.css';
import Nav from './components/Nav';
import Banner from './components/Banner';
import Row from './components/Row';

function App() {
  return (
    <div className="App">
      <Nav />
      <Banner />
      <Row 
        title="NETFLIX ORIGINALS"
        id="No"
        fetchUrl={requests.fetchNetflixOriginal}
      />
    </div>
  );
}

export default App;
